import AllPlayersPicksPage from './AllPlayersPicksPage';
import React, { useState } from 'react';
import PlaceYourPicks from './PlaceYourPicks';

const PlayersPage = () => {
  const [activeTab, setActiveTab] = useState('placePicks');

  return (
    <div className="p-4">
      {/* Top Tab Navigation */}
      <div className="flex flex-wrap gap-4 mb-6 text-sm font-semibold border-b pb-2">
        <button onClick={() => setActiveTab('placePicks')}>Place Your Picks Here</button>
        <button onClick={() => setActiveTab('allPicks')}>All Players' Picks Page</button>
        <button onClick={() => setActiveTab('spread')}>The Spread by Week</button>
        <button onClick={() => setActiveTab('scores')}>Weekly Scores</button>
        <button onClick={() => setActiveTab('payments')}>Player Roster & Payments</button>
        <button onClick={() => setActiveTab('adminTools')}>Administration Tools</button>
        <button onClick={() => setActiveTab('rules')}>Rules</button>
        <button onClick={() => setActiveTab('chat')}>Chat</button>
      </div>

      {/* Display Selected Tab */}
      {activeTab === 'placePicks' && <PlaceYourPicks />}
      {activeTab === 'allPicks' && <div>üìã All Players' Picks Page coming soon...</div>}
      {activeTab === 'allPicks' && <AllPlayersPicksPage />}
      {activeTab === 'scores' && <div>üìä Weekly Scores coming soon...</div>}
      {activeTab === 'payments' && <div>üíµ Player Payments coming soon...</div>}
      {activeTab === 'adminTools' && <div>üõ†Ô∏è Admin Tools Login coming soon...</div>}
      {activeTab === 'rules' && <div>üìò Rules page coming soon...</div>}
      {activeTab === 'chat' && <div>üí¨ Player Chat board coming soon...</div>}
    </div>
  );
};

export default PlayersPage;
